import React, { useState, useEffect } from 'react';
import AudioPlayer from 'react-audio-player';

const AudioPlayerComponent = () => {
  const [audioUrl, setAudioUrl] = useState('');

  useEffect(() => {
    // Replace with the URL of your S3 bucket and audio file
    const s3AudioUrl = 'https://amplify-amplifya785c969872c4-staging-111600-deployment.s3.amazonaws.com/i_like_cake.mp3';
    setAudioUrl(s3AudioUrl);
  }, []);

  return (
    <div>
      <h1>Audio Player</h1>
      <AudioPlayer src={audioUrl} controls />
    </div>
  );
};

export default AudioPlayerComponent;
